import React from 'react';

const HomePage = () => {
    return (
        <div>
            <h1>Welcome to the Athlete's Home Page</h1>
            <p>This is your personal dashboard where you can view your activities, track progress, and much more.</p>
            <p>Feel free to explore the various sections of your dashboard.</p>
        </div>
    );
};

export default HomePage;
